  return (
    <form className = "inputForm" action="">
    <ul>
      <li><h2>비밀번호 찾기</h2></li>
      <li><input placeholder="이메일 주소"  type="text" /></li>
      <li><button>비빌번호 찾기</button></li>
    </ul>
  </form>
  )
}

export default FindPw;
